import Adriana from '../images/adriana.jpg'

const data = [
    {
        id: 1,
        image: '../images/tarot.png',
        title: 'test 1',
        category: ['javascript', 'html']
    },
    {
        id: 2,
        image: `${Adriana}`,
        title: 'test 2',
        category: ['javascript', 'html']
    },
]

export default data
